function loadcart() {
    var adc = document.getElementById('ad-content');
    var i = document.createElement('a');
    i.classList.add('container');
    var i1 = document.createElement('span');
    i1.style.display = 'flex';
    orderitems.forEach((el) => {
        var i3 = document.createElement('img');
        if (el in men) {
            i3.src = men[el].img;
        }
        else if (el in women) {
            i3.src = women[el].img;
        }

        else if (el in children) {
            i3.src = children[el].img;
        }
        i3.style.padding = '10px';
        i3.style.height = '200px';
        i1.appendChild(i3);
    })
    i.appendChild(i1);
    adc.appendChild(i);
}
